import './App.css';
import Axios from 'axios'


function App() {

   const [data,setdata ] = useState("")
   const [data2,setdata2] = useState(5)

   const getData = async()=>{
    const response = await Axios.get("http://localhost:5001/getData").catch(err=>console.log(err))
    setdata(response.data)
   }

    const postData = async()=>{
      const theresponse = await Axios.post("http://localhost:5001/getData",data2).then(alert("success"))
      const result = theresponse.data

    }

   useEffect(()=>{
    getData()
    postData()
   },[])
  return (
    <div className="App">
     <input type="text" />
     <div>{data}</div>
     <div>{result}</div>
    </div>
  );
}

export default App;
